    <div>
      <BrowserRouter>
      <Navbar/> 
      <Routes>
      <Route path='/' element={<Shop/>}/> 
      <Route path='/toys' element={<ShopCategory category="toys" />}/> 
      <Route path='/kitchenware' element={<ShopCategory category="kitchenware" />}/> 
      <Route path='/stationery' element={<ShopCategory category="stationery" />}/> 
      <Route path="product" element={<product/>} >
        <Route path=':productId' element={<product/>}/>
      </Route>

      </Routes>
      </BrowserRouter>     
    </div>
  );
}

